		<script>
			const StageEF = () => {
				appObj.time_current = performance.now();
				if (appObj.time_current - appObj.time_old > 25) {
					appObj.time_old = appObj.time_current;
					// 33 - 30 fps
					// 16 - 60 fps

					let i, j, k;
					let objTemp;
					let objTempExtra;
					//- Camera

					if (appMc.mcWorldShake.shakeD != 0) {
						appMc.mcWorldShake.shakeAX += 70;
						appMc.mcWorldShake.shakeAY += 90;
						if (appMc.mcWorldShake.shakeAX >= 360) {
							appMc.mcWorldShake.shakeAX -= 360;
						}
						if (appMc.mcWorldShake.shakeAY >= 360) {
							appMc.mcWorldShake.shakeAY -= 360;
						}
						appMc.mcWorldShake.x =
							appMc.mcWorldShake.shakeD *
							Math.cos(appMc.mcWorldShake.shakeAX * toRAD);
						appMc.mcWorldShake.y =
							appMc.mcWorldShake.shakeD *
							Math.cos(appMc.mcWorldShake.shakeAY * toRAD);
						appMc.mcWorldShake.shakeD *= 0.85;
						if (appMc.mcWorldShake.shakeD < 0.5) {
							appMc.mcWorldShake.shakeD = 0;
							appMc.mcWorldShake.x = 0;
							appMc.mcWorldShake.y = 0;
						}
					}

					tmDebug++;
					if (tmDebug == 100) {
						tmDebug = 0;
					}
					// if (tmDebug % 5 === 0) {

					// }
					if ("mcLightening" in appMc) appMc.mcLightening.update();

					//- PIXI RENDER

					renderer.render(stage);

					//- P2 World
					if (physics) {
						appMc.p2world.step(1 / 60);
					}

					//- P2 World
					// window.addEventListener("resize", () => AppResize());

					//- RESIZE

					objTemp = appObj;
					objTemp.tm_resize++;
					if (objTemp.tm_resize == 10) {
						objTemp.tm_resize = 0;

						if (
							objTemp.mainWidth != Math.ceil(window.innerWidth) ||
							objTemp.mainHeight != Math.ceil(window.innerHeight)
						) {
							AppResize();
						}
					}
				}

				//- RAF
				window.requestAnimationFrame(StageEF);
			};

			//- Sound

			const aLoadSounds = [
				{
					name: "bg",

				baseTextures: {},
				threeTextures: {},
				pixiTextures: {},
				funComplete: null,
				load: function (_funComplete) {
					moduleTexture.funComplete = _funComplete;
					moduleTexture.loadTexture();
				},
				idLoadTexture: 0,
				loadTexture: function () {
					if (moduleTexture.idLoadTexture < moduleTexture.textures.length) {
						moduleTexture.baseTextures[
							moduleTexture.textures[moduleTexture.idLoadTexture].name
						] = new Image();

						moduleTexture.baseTextures[
							moduleTexture.textures[moduleTexture.idLoadTexture].name
						].onload = moduleTexture.loadTextureComplete;
						moduleTexture.baseTextures[
							moduleTexture.textures[moduleTexture.idLoadTexture].name
						].onerror = moduleTexture.loadTextureError;
						moduleTexture.baseTextures[
							moduleTexture.textures[moduleTexture.idLoadTexture].name
						].src = moduleTexture.textures[moduleTexture.idLoadTexture].path;
					} else {
						moduleTexture.funComplete();
					}
				},
				loadTextureComplete: function () {
					moduleTexture.pixiTextures[
						moduleTexture.textures[moduleTexture.idLoadTexture].name
					] = PIXI.Texture.from(
						moduleTexture.textures[moduleTexture.idLoadTexture].path
					);

					moduleTexture.idLoadTexture++;
					moduleTexture.loadTexture();
				},
				loadTextureError: function () {
					setTimeout(moduleTexture.loadTexture, 200);
				},
			};

			//-

			const AppCanvas = document.createElement("canvas");
			let renderer;
			let stage;

			let i, j, k, n;

			let appObj = {
				time_old: 0,
				time_current: 0,
				tm_resize: 0,
				mainWidth: 0,
				mainHeight: 0,
			};
			let tmDebug = 0;

			//-

			let appMc = {};

			let lvlScore = 0;

			let manipulate = 0;

			let gameScore = 0;
			let toRAD = Math.PI / 180;
			let stateGame = 0;
			let mouse = { x: 0, y: 0 };
			let itemDrag = false;
			let scratch = false;
			let drawItem = 0;
			let itemScratch = null;
			let scratchSize = 40;

			let physics = true;

			//---------------------------------------------------------------------------------

			window.onload = () => {
				try {
					if (mraid.getState() === "loading") {
						mraid.addEventListener("ready", mraidIsReady);
					} else {
						LoadTextures();
					}
				} catch (e) {
					LoadTextures();
				}
			};
			const Orientation = (e) => {
				AppResize();

				renderer.render(stage);
			};
			const mraidIsReady = () => {
				try {
					mraid.addEventListener("orientationchange", Orientation);
					if (mraid.isViewable()) {
					} else {
						mraid.addEventListener("viewableChange", mraidIsViewable);
					}
				} catch (e) {}

				mraid.removeEventListener("ready", mraidIsReady);
				LoadTextures();
			};
			const mraidIsViewable = (viewable) => {
				if (viewable) {
					mraid.removeEventListener("viewableChange", mraidIsViewable);
				} else {
				}
			};

			//---------------------------------------------------------------------------------

			const LoadTextures = () => {
				try {
					var mraidGetMaxSize = mraid.getMaxSize();
				} catch (e) {}

				moduleTexture.load(CompleteLoadAllMaterials);
			};

			const CompleteLoadAllMaterials = () => {
				//- InitPixi

				InitPixi();

				//- InitBasicObj

				InitBasicObj();

				//- Resize

				AppResize();

				window.addEventListener("resize", AppResize);

				//- Animation
				InitAnimation();

				//- EF
				StageEF();
			};

			// init basic obj
			const InitBasicObj = () => {
				//- mcMain
				appSounds.bg.play();

				appMc.mcMain = new createContainer({ p: stage, visible: false });
				appMc.mcGame = new createContainer({ p: appMc.mcMain });

				appMc.mcGame.twistFilter = new PIXI.filters.TwistFilter({
					angle: 4,
					offset: { x: 640, y: 640 },
					radius: 800,
					padding: 20,
				});

				appMc.mcWorldShake = new createContainer({ p: appMc.mcGame });
				appMc.mcWorldShake.shakeAX = 0;
				appMc.mcWorldShake.shakeAY = 0;
				appMc.mcWorldShake.shakeD = 0;

				if (physics) {
					appMc.p2world = new p2.World({ gravity: [0, -500] });

					// Add a plane
					planeShape = new p2.Plane();
					planeBody = new p2.Body({ position: [0, -100] });
					planeBody.addShape(planeShape);
					appMc.p2world.addBody(planeBody);
				}

				//Back
				appMc.mcWorldCamera = new createContainer({ p: appMc.mcWorldShake });

				appMc.mcBg = new createSprite({ p: appMc.mcWorldCamera, tex: "bg" });

			// function to change the previous active item to the current
			function changeActiveItem(prevItemId, nextItemId) {
				appMc[`bg-active-${prevItemId}`].visible = false;
				appMc[`bg-${prevItemId}`].visible = true;

				appMc[`bg-active-${nextItemId}`].visible = true;
				appMc[`bg-${nextItemId}`].visible = false;
			}

			// function to find the active skin
			function findTheActiveSkin() {
				for (let i = 2; i < 6; i++) {
					if (appMc[`bg-active-${i}`].visible === true) {
						return i;
					}
				}
			}

			// function to show stage2
			function showStage2(id) {
				appMc.mcStage2Container.visible = true;
				if ("mcEnlargedImg" in appMc) {
					appMc.mcStage2Container.removeChild(appMc.mcEnlargedImg);
				}
				if ("mcLightening" in appMc) {
					appMc.mcStage2Container.removeChild(appMc.mcLightening);
				}
				// The lightening Sequence
				appSounds.cracking.play();
				appMc.mcLightening = new createSequence({
					p: appMc.mcStage2Container,
					tex: "lightening-sequence",
					data: aDataFrames,
					prefix: "frame_",
					frame: 0,
					totalFrame: 8,
					loop: false,
					slow: 3,
					x: 0,
					y: +450,
					scale: 1.2,
				});
				appMc.mcEnlargedImg = new createSprite({
					p: appMc.mcStage2Container,
					tex: `enlarged-skin-${id}`,
					x: 0,
					y: 0,
					scale: 0.7,
				});

				gsap.from(appMc.mcEnlargedImg.scale, 0.5, {
					delay: 0,
					overwrite: "none",
					ease: "Sine.easeIn",
					x: 0,
					y: 0,
				});

				appMc.mcStage2Container.setChildIndex(appMc.mcLightening, 0);

				AppResize();
			}

			// gsap animation for the next and previous btns
			function gsapAnimation(btn) {
				gsap.killTweensOf(appMc[btn].scale);
				gsap.to(appMc[btn].scale, 0.1, {
					overwrite: "none",
					x: 0.6,
					y: 0.6,
					ease: "Sine.easeOut",
					delay: 0,
				});
				gsap.from(appMc[btn].scale, 0.1, {
					overwrite: "none",
					x: 0.6,
					y: 0.6,
					ease: "Sine.easeIn",
					delay: 0,
				});
			}

			// fuction to handle the direct user on click the skin => stage moves to the final stage
			function onClickSkin(skinId) {
				appSounds.click.play();
				previousActiveId = findTheActiveSkin();
				changeActiveItem(previousActiveId, skinId);
				stage1Animation();

				setTimeout(() => {
					appMc.mcStage1Container.scale.set(0);

					// appMc.mcStage1Container.visible = false;

					showStage2(skinId);
				}, 300);
			}

			// function to handle the on select a specific skin => stage moves to the next page
			function onSelect() {
				let id = findTheActiveSkin();
				stage1Animation();

				setTimeout(() => {
					appMc.mcStage1Container.scale.set(0);
					// appMc.mcStage1Container.visible = false;
					showStage2(id);
				}, 300);
			}

			// Function to handle on click back btn
			function onClickPrevious() {
				appSounds[`btn-click`].play();
				gsapAnimation("mcPreviousBtn");
				currentItemId = findTheActiveSkin();
				prevItemId = currentItemId - 1;
				if (currentItemId === 2) prevItemId = 5;
				changeActiveItem(currentItemId, prevItemId);
			}

			// Function to handle on Click next button
			function onClickNext() {
				appSounds[`btn-click`].play();
				gsapAnimation("mcNextBtn");
				prevItemId = findTheActiveSkin();
				nextItemId = prevItemId + 1;
				if (prevItemId === 5) nextItemId = 2;
				changeActiveItem(prevItemId, nextItemId);
			}

			// Function to handle the arrow back click
			function goBack() {
				// appMc.mcDefaultSkin.scale.set(appObj.currentDefaultSkinScale);
				// appMc.mcSelectBtnContainer.scale.set(1.4 / appMc.mcUI.scale.y);

				appMc.mcStage2Container.visible = false;

				appMc.mcStage1Container.scale.set(1);

				AppResize();

			const EndGame = () => {
				let i, objTemp;
				if (stateGame != 10) {
					stateGame = 10;

					appMc.mcBgFS.visible = true;
				}
			};

			const StageDown = (e) => {
				if (stateGame == 0) {
					stateGame = 1;
					if (!isGlobalActive) {
						isGlobalActive = true;
						isGlobalSound = true;
						Howler.mute(!isGlobalSound);
					}
				}
				mouse.isDown = true;
			};
			const StageMove = (e) => {
				if (mouse.isDown) {
					mouse.x = e.data.getLocalPosition(appMc.mcWorldCamera).x;
					mouse.y = e.data.getLocalPosition(appMc.mcWorldCamera).y;
				}
			};
			const StageUp = (e) => {
				mouse.isDown = false;

				//	appMc.mcConfetti = new Confetti({p:appMc.mcUI, count:100});

				// appMc.mcSparkle = new itemSparkle({
				// 	p: appMc.mcUI,

				// 	dx: 15,
				// 	dy: 15,
				// 	s: 0.5,
				// });
			};
			const BtnGlobalSound = (e) => {
				if (isGlobalSound) {
					isGlobalSound = false;

					appMc.mcBtnSoundB.texture =
						moduleTexture.pixiTextures["btn_sound_off"];

					Howler.mute(true);
				} else {
					isGlobalSound = true;

					appMc.mcBtnSoundB.texture =
						moduleTexture.pixiTextures["btn_sound_on"];

					Howler.mute(false);
				}
			};

			function stage1Animation() {
				let tl = gsap.timeline();
				tl.to(

					0.3,

						delay: 0.0,
						overwrite: "none",
						x: 0,
						y: 0,
						ease: Back.easeIn,
					},
					"cool"
				)
					// Buttons container and actual buttons
					.to(
						appMc.mcSelectBtnContainer.scale,
						0.3,
						{
							delay: 0.0,
							overwrite: "none",
							x: 0,
							y: 0,
							ease: Back.easeIn,
						},
						"cool"
					);
			}

			//- Resize

			const AppResize = (e) => {
				appObj.mainWidth = Math.ceil(window.innerWidth);
				appObj.mainHeight = Math.ceil(window.innerHeight);
				appObj.canvasWidth = Math.ceil(1.4 * window.innerWidth);
				appObj.canvasHeight = Math.ceil(1.4 * window.innerHeight);

				renderer.view.style.width = appObj.mainWidth + "px";
				renderer.view.style.height = appObj.mainHeight + "px";
				renderer.view.width = appObj.canvasWidth;
				renderer.view.height = appObj.canvasHeight;

				renderer.resize(appObj.canvasWidth, appObj.canvasHeight);

				stage.position.set(
					Math.ceil(appObj.canvasWidth * 0.5),
					Math.ceil(appObj.canvasHeight * 0.5)
				);

				//- POSITION OBJ

				appMc.mcGame.scale.set(1, 1);
				appMc.mcUI.scale.set(1, 1);

				// common resize of the default skin
				// appMc.mcDefaultSkin.y = appObj.canvasHeight / 2 / appMc.mcUI.scale.y - 300;

				if (appObj.mainWidth < appObj.mainHeight) {

						appMc.mcGame.scale.x = appMc.mcGame.scale.y;

					appMc.mcUI.scale.y = appMc.mcUI.scale.x;
					if (appMc.mcUI.scale.y * 1280 > appObj.canvasHeight) {
						appMc.mcUI.scale.y = appObj.canvasHeight / 1280;
						appMc.mcUI.scale.x = appMc.mcUI.scale.y;
					}

					appMc.mcBgFS.scale.x =
						0.1 + appObj.canvasWidth / 1280 / appMc.mcUI.scale.x;
					appMc.mcBgFS.scale.y =
						0.1 + appObj.canvasHeight / 1280 / appMc.mcUI.scale.x;

					for (let x = 2; x < 6; x++) {

						delay: 0,
						x: 0.9,
						y: 0.9,
						yoyo: true,
						repeat: -1,
						ease: "Sine.easeInOut",
					});

					appMc.mcHorizontalChooseSkinText.y = -(
						(0.4 * appObj.canvasHeight) /
						appMc.mcUI.scale.y
					);

					for (let x = 2; x < 6; x++) {
						let position =
							(-0.6 * appObj.canvasWidth * 0.5) / appMc.mcUI.scale.y;
						if (x === 3) {
							position = (-0.2 * appObj.canvasWidth * 0.5) / appMc.mcUI.scale.y;
						}
						if (x === 4) {
							position = (0.2 * appObj.canvasWidth * 0.5) / appMc.mcUI.scale.y;
						}
						if (x === 5) {
							position = (0.6 * appObj.canvasWidth * 0.5) / appMc.mcUI.scale.y;
						}
						appMc[`bgC-${x}`].x = position;
						appMc[`bgC-${x}`].y = -(
							(0.38 * appObj.canvasHeight * 0.5) /
							appMc.mcUI.scale.y
						);
						appMc[`bgC-${x}`].scale.x = 1;
						appMc[`bg-${x}`].scale.x = 1.4;
						appMc[`bg-active-${x}`].scale.x = 1.4;

						// appMc[`bgC-${x}`].scale.x = 1;
						// appMc[`skin-${x}`].scale.x = 0.1;
					}

					appMc.mcSelectBtnContainer.y =
						((appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y) * 0.88;

					appMc.mcSelectBtnContainer.scale.set(1.2);
					// appMc.mcSelectBtnContainer.scale.set(1.2 / appMc.mcUI.scale.y);

					// appMc.mcDefaultSkin.scale.set(1 / appMc.mcUI.scale.y);
					appMc.mcDefaultSkin.scale.set(0.55);
					appMc.mcDefaultSkin.y = 125;

					appMc.mcStageTwoTopContainer.y =
						80 - (appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y;

					appMc.mcBackArrow.x =
						50 + (-appObj.canvasWidth * 0.5) / appMc.mcUI.scale.x;

					// Resizing the take the skin btn
					// appMc.mcTakeTheSkinText.scale.set(0.6);

					appMc.mcTakeTheSkinText.y =
						-80 + (appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y;

					if (appMc.mcStage2Container.visible) {
						gsap.from(appMc.mcTakeTheSkinText.scale, 0.5, {
							x: 0.8,
							y: 0.8,
							overwrite: "none",
							ease: "Sine.easeInOut",
							delay: 0,
							yoyo: true,
							repeat: -1,
						});
					}
				}
			};
			// Resize
		</script>
	</body>
</html>
